import React from 'react';
import Box from '@mui/material/Box';
import Typography from '@mui/material/Typography';

function Footer() {
  return (
    <Box component="footer" sx={{ textAlign: 'center', py: 2, bgcolor: 'primary.main', color: 'white', mt: 4, borderRadius: '0 0 8px 8px' }}>
      <Typography variant="body2">&copy; {new Date().getFullYear()} CloudCommerce. All rights reserved.</Typography>
    </Box>
  );
}

export default Footer;
